function AttributeBoatConfig.GetConfig(key)
	local tb = AttributeBoatConfig.Values[key]
	if not tb then
		print_error(string.format("key type is %s,key = %s",type(key),key))
		return nil
	end
	local config = {["id"] = 1,["typename"] = 2,["quality"] = 3,["birthstar"] = 4,["typeship"] = 5,["country"] = 6,["fetterstype"] = 7,["position"] = 8,["position_range"] = 9,["priority"] = 10,["normalskill"] = 11,["atkskill"] = 12,["activeskill"] = 13,["awakeningskill"] = 14,["time"] = 15,["dialogue"] = 16,["cv"] = 17,["accessorypos"] = 18,["equip"] = 19,["original"] = 20,["equipunlock"] = 21,["storygroup"] = 22,["skincfg"] = 23,["nickname"] = 24,["painter"] = 25,["allocation"] = 26,["colour"] = 27,["source"] = 28,["retirebase"] = 29,["marryresoure"] = 30,["nazo"] = 31,}
	for k,v in pairs(config) do
		config[k] = tb[v]
	end
	return config 
end
return AttributeBoatConfig